import styles from '../pages_css/Home.css';
import Navbar from '../compenents/Navbar.js';
import Footer from '../compenents/Footer.js';

const Home = () => {
  return (
    <div className="home">


    <div className="quick_click_3">
      <div className="container">
        <a href="#" className="navbar-link Sneakers-link">
            <div className="text">Sneakers</div>
        </a>
        
        <a href="#" className="navbar-link Shoes-link">
            <div className="text">Shoes</div>
        </a>


        <a href="#" className="navbar-link Popular-link">
            <div className="text">Popular brand</div>
        </a>
      </div>
    </div>

      

    </div>
  );
};

export default Home;
